var mapPerf = {};
var tmpCode = "";
var mapAdditional = {};
var treemap;

function restoreParents(data, parent = null) {
  data.parent = parent;
  (data.children || []).forEach((d) => restoreParents(d, data));
}

function restorePerf(data) {
  data.perf = mapPerf[data.name] ?? data.perf;
  data.additional = mapAdditional[data.name] ?? data.additional;
  (data.children || []).forEach((d) => restorePerf(d));
}

function initMap(width, mapData, color, ignoreAuth, price) {
  restoreParents(mapData);
  restorePerf(mapData);
  initCanvas(mapData, "sec", "", width, color, "", "", true, ignoreAuth, price);
  initCanvas(mapData, "sec", "", width, color, "", "", true, ignoreAuth, price);
}

function drawMap(color, ignoreAuth) {
  const calculateHeight = () => {
    let height =
      Math.max(document.documentElement.clientHeight, window.innerHeight || 0) -
      10;

    if (!$(".narrow").is(":visible")) {
      height -= 100;
    }

    return height;
  };

  const height = calculateHeight();
  $("#body").height(height + 30);

  const width = $("#main-body").width();

  const treemap = d3.layout
    .treemap()
    .sort((d1, d2) => d1.scale - d2.scale)
    .size([width, height])
    .value((d) => d.scale)
    .padding((d) => {
      if (d.depth === 1) {
        return [17, 1, 1, 1];
      } else if (d.depth === 2) {
        return [12, 1, 2, 1];
      }
      return 0;
    });

  const response = {
    errcode: 0,
    errmsg: "success",
    data: {
      children: [
        {
          children: [
            {
              children: [
                { name: "丰乐种业", scale: 5090184184, id: "000713.SZ" },
                { name: "隆平高科", scale: 18675139772, id: "000998.SZ" },
                { name: "登海种业", scale: 1.76792e10, id: "002041.SZ" },
                { name: "众兴菌业", scale: 3359893258, id: "002772.SZ" },
                { name: "荃银高科", scale: 9101856229, id: "300087.SZ" },
                { name: "神农科技", scale: 3881090182, id: "300189.SZ" },
                { name: "雪榕生物", scale: 2621056437, id: "300511.SZ" },
                { name: "华绿生物", scale: 1224643768, id: "300970.SZ" },
                { name: "万辰生物", scale: 8.5514688e8, id: "300972.SZ" },
                { name: "亚盛集团", scale: 5996498573, id: "600108.SH" },
                { name: "农发种业", scale: 10214359012, id: "600313.SH" },
                { name: "敦煌种业", scale: 3.03486196e9, id: "600354.SH" },
                { name: "新农开发", scale: 3101699227, id: "600359.SH" },
                { name: "万向德农", scale: 3.47582664e9, id: "600371.SH" },
                { name: "香梨股份", scale: 1496270623, id: "600506.SH" },
                { name: "新赛股份", scale: 2592941242, id: "600540.SH" },
                { name: "北大荒", scale: 23678696388, id: "600598.SH" },
                { name: "海南橡胶", scale: 18144773859, id: "601118.SH" },
                { name: "苏垦农发", scale: 1.72939e10, id: "601952.SH" },
                { name: "宏辉果蔬", scale: 2658698455, id: "603336.SH" },
              ],
              name: "种植业",
              scale: 154176736689,
              id: "110100",
            },
          ],
          name: "农林牧渔",
          scale: 1118033637266,
          id: "110000",
        },
      ],
      name: "总量",
      scale: 12669.20014237675,
      id: "9",
    },
  };
  const result = response.data;

  sessionStorage.setItem(tmpCode, JSON.stringify(result));
  render(treemap, result, color, ignoreAuth);

  function render(treemap, result, color, ignoreAuth) {
    const nodes = treemap.nodes(result);

    const mapPerf = nodes.reduce((obj, node) => {
      if (node.condition) {
        obj[node.name] = node.condition;
      }
      return obj;
    }, {});

    const mapData = nodes[0];
    initMap(width, mapData, color, ignoreAuth);
  }
}

function getRangeLegend(colorArr, valueRangeArr) {
  var map_scaleHtml = "";
  for (var i = 0; i < colorArr.length; i++) {
    map_scaleHtml +=
      '<div class="step" style="background:' +
      colorArr[i] +
      ';">' +
      valueRangeArr[i] +
      "</div>";
  }
  $(".map_scale").html(map_scaleHtml);
}

